import styled from "styled-components";

import HorizontalLine from "../../../HorizontalLine";

const ContainerTable = styled.div`
  width: 75%;
`;

const Table = ({}) => {
  return (
    <ContainerTable>
      <HorizontalLine ></HorizontalLine>
    </ContainerTable>
  );
};

export default Table;
